Inside your Cargo.toml First, you need to add the phink feature to your Cargo.toml, such as: [features]
phink = [] Inside your file.rs Then, you can use the following example to create invariants. You need to create another impl if your contract, and to put it under the feature of phink. Use assert! or panic! for your properties. #[cfg(feature = "phink")]
#[ink(impl)]
impl DomainNameService { // This invariant ensures that nobody registed the forbidden number #[ink(message)] #[cfg(feature = "phink")] pub fn phink_assert_dangerous_number(&self) { let forbidden_number = 42; assert_ne!(self.dangerous_number, forbidden_number); }
} You can find more informations in the page dedicated to invariants .

